static const uint8_t JMEBB[] = {
    1,
    0x72
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMEBData(char *Buffer)
{
    memcpy(Buffer, &JMEBL0[1], JMEBL0[0] << 2);
    Buffer += (JMEBL0[0] << 2);

    memcpy(Buffer, &JMEBL1[1], JMEBL1[0] << 2);
    Buffer += (JMEBL1[0] << 2);

    memcpy(Buffer, &JMEBL2[1], JMEBL2[0] << 2);
    Buffer += (JMEBL2[0] << 2);

    memcpy(Buffer, &JMEBL3[1], JMEBL3[0] << 2);
    Buffer += (JMEBL3[0] << 2);

    memcpy(Buffer, &JMEBL4[1], JMEBL4[0] << 2);
    Buffer += (JMEBL4[0] << 2);

    memcpy(Buffer, &JMEBB[1], JMEBB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMEBName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMEBData(void)
{
    remove(JMEBName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMEBData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMEBName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMEBName)) return "";
    #endif

    if (!(han = fopen(JMEBName, "wb"))) return "";
    if (AutoClean) atexit(KillJMEBData);

    num = fwrite(&JMEBL0[1], 4, JMEBL0[0], han);
    if (num != JMEBL0[0]) {fclose(han); return "";}

    num = fwrite(&JMEBL1[1], 4, JMEBL1[0], han);
    if (num != JMEBL1[0]) {fclose(han); return "";}

    num = fwrite(&JMEBL2[1], 4, JMEBL2[0], han);
    if (num != JMEBL2[0]) {fclose(han); return "";}

    num = fwrite(&JMEBL3[1], 4, JMEBL3[0], han);
    if (num != JMEBL3[0]) {fclose(han); return "";}

    num = fwrite(&JMEBL4[1], 4, JMEBL4[0], han);
    if (num != JMEBL4[0]) {fclose(han); return "";}

    num = fwrite(&JMEBB[1], 1, JMEBB[0], han);
    if (num != JMEBB[0]) {fclose(han); return "";}

    fclose(han);
    return JMEBName;
}

